import React, { Component } from "react";

class MessageClass extends Component {

    constructor(){

        super()
        this.state = {
            message: 'Welcome, message onstructor'
        }
    }

    render() {

        return <h1>{this.state.message}}</h1>
    }
}

export default MessageClass
